import React, { useContext } from "react";
import { GlobalContext } from "../context/GlobalState";

export const Feed = () => {
  const { post } = useContext(GlobalContext);
  console.log(post);

  return (
    <div className="feed">
      {post.map(postObject => {
        return (<p key={postObject.id}>
            {postObject.user+ "\r"  + postObject.text}
        </p>)
      })}
    </div>
  );
};
